lib.skill.cazhenfeng.chooseButton.backup = function (links) {
  return {
    audio: 'cazhenfeng',
    popname: true,
    link: links[0],
    content: function () {
      'step 0';

      player.awakenSkill('cazhenfeng');
      if (lib.skill.cazhenfeng_backup.link == 0) {
        player.logSkill('cazhenfeng');
        player.recover(2);
        player.swapBackground('cazhenfeng', 1);
        OLUI.utility.stupidHuaguoshan("OL_taishici_jineng_gong", 'screen', "extension/OLUI/extensions/skills/effects/", null, 1.2, 700, 332);
        event.finish();
      }
      event.skills = [], event.listx = [];
      if (player.hasSkill('cahanzhan')) {
        event.skills.push('cahanzhan');
      }
      if (player.hasSkill('cazhanlie')) {
        event.skills.push('cazhanlie');
      }
      'step 1';
      if (!event.count) event.count = event.skills.length;
      var list = ['当前体力值', '当前已损失体力值', '场上存活角色数'];
      player.chooseControl(list).set('prompt', `请为${get.translation(event.skills[event.count - 1])}选择一项数值以固定`).set('ai', () => {
        var max = Math.max(player.hp, player.maxHp - player.hp, game.countPlayer());
        if (player.hp == max) {
          return '当前体力值';
        }
        if (player.maxHp - player.hp == max) {
          return '当前已损失体力值';
        }
        if (game.countPlayer() == max) {
          return '场上存活角色数';
        }
      });
      'step 2';
      if (result.control) {
        event.listx.push(result.control);
      }
      event.count--;
      if (event.count > 0) {
        event.goto(1);
      }
      'step 3';
      player.logSkill('cazhenfeng');
      for (var i = 0; i < event.skills.length; i++) {
        player.storage[event.skills[i]] = event.listx[i];
        player.popup(event.skills[i]);
        game.log(player, '修改', `#g【${get.translation(event.skills[i])}】`, '的', '#yX', '为', `#g${event.listx[i]}`);
      }
      if (event.listx.length > 1) {
        var sekl = null;
        if (event.listx[0] == '当前体力值') {
          player.swapBackground('cazhenfeng', 3);
          sekl = 'jian';
        }
        if (event.listx[0] == '当前已损失体力值') {
          player.swapBackground('cazhenfeng', 2);
          sekl = 'duanjian';
        }
        if (event.listx[0] == '场上存活角色数') {
          player.swapBackground('cazhenfeng', 4);
          sekl = 'qiang';
        }
        if (sekl != null) {
          OLUI.utility.stupidHuaguoshan("OL_taishici_jineng_" + sekl, 'screen', "extension/OLUI/extensions/skills/effects/", null, 1.2, 700, 332);
        }
      }
    }
  };
};